Upgrade to Screamin’ Eagle Factory Race Team suspension with the all-new Screamin' Eagle/Öhlins Remote Reservoir Rear Shocks for H-D Touring models.

Fully adjustable for preload and compression/rebound damping, with a remote reservoir for optimal performance and style. Use these shocks to dial in your ideal combination of handling and ride, for the street or the track. Ride like a winner. Learn more at the link in our bio. 
@OhlinsUSA @OhlinsRacing
